import React, { Component } from 'react';
import {Row,Col } from 'react-bootstrap';
import Data from '../Data';

class NavigationLeft extends Component {
    constructor(props) {
        super(props);
        this.state = {
            content: []
        }
      }
      buildContent() {
        let _content = [];
    
        let data = Data.data;
        for(var i in data) {
            _content.push(
                <Col key={i} xs={6} md={4}>
                    <a  href="/product-id=">
                    <Product data={data[i]}></Product>
                    </a>
                </Col>
            );
        }
        let _productContent = [];
        _productContent.push(<Grid key="content"><Row key={i}>{_content}</Row></Grid>);
        return _productContent;
      }
    
      componentDidMount() {
        this.setState({
            content: this.buildContent()
        });
    }


  render() {
    return (
        <div className="new-product">
            <Row className="my-row">
                <Col sm={3} lg={3} md={3} xs={3} >
                    <hr className="line-decoration"/>
                </Col>
                <Col sm={6} lg={6} md={6} xs={6} >
                    <h1 className="unit"><b>NEW PRODUCT</b></h1>
                </Col>
                <Col sm={3} lg={3} md={3} xs={3} >
                    <hr className="line-decoration"/>
                </Col>
            </Row>
            <br/><br/>
            <Row className="my-row">
                <Col sm={4} lg={4} md={4} xs={4} >
                    <img src="assets/images/product/product-1.png" alt="" className="product"></img>
                    <h4 className="title"><strong>Fender</strong></h4>
                    <p>This is my Guitar. Don't sell<br/>$13.99</p>
                </Col>
                <Col sm={4} lg={4} md={4} xs={4} >
                    <img src="assets/images/product/product-2.png" alt="" className="product"></img>
                    <h4 className="title"><strong>Fender T-Bucketâ„¢ 200 CE</strong></h4>
                    <p>This is my Guitar. Don't sell<br/>$13.99</p>
                </Col>
                <Col sm={4} lg={4} md={4} xs={4} >
                    <img src="assets/images/product/product-3.png" alt="" className="product"></img>
                    <h4 className="title"><strong>Fender CD-100-12 NAT</strong></h4>
                    <p>This is my Guitar. Don't sell<br/>$13.99</p>
                </Col>
            </Row>
        </div>
    );
  }
}

export default NavigationLeft;
